import {Component, EventEmitter, Input, Output} from '@angular/core';
import {Wine} from "../wine/model/wine.model";

@Component({
  selector: 'app-wine-card',
  templateUrl: './wine-card.component.html',
  styleUrls: ['./wine-card.component.css']
})
export class WineCardComponent {

  @Input()
  wine: Wine;

  @Output()
  clicked: EventEmitter<Wine> = new EventEmitter<Wine>();

  onWineClicked(): void {
    this.clicked.emit(this.wine);
  }

}
<mat-card>
<!--  (click)="onWineClicked()"-->
  <mat-card-content>
    <b [routerLink]="['/wine', wine.id]">{{wine.name}}</b>
    <p>{{wine.country}}</p>
    <p>{{wine.year}}</p>
  </mat-card-content>
</mat-card>
